import {Navbar} from 'react-bootstrap'

export default function NavbarHead(){
    return(
        // eslint-disable-next-line react/jsx-no-undef
        <Container>
            <Navbar expand="lg" variant="light" bg="light">
                    <Navbar.Brand href="#">Navbar</Navbar.Brand>
            </Navbar>
        </Container>
    )
}
